import React from 'react'
import { BrowserRouter as Router } from 'react-router-dom'
import Routes from './Routes'
import Graph from './Graph'

const App = (props) => {
  return (
    <Router>
      <Graph />
      <Routes />
    </Router>
  )
}

export default App
